import React, {Component} from 'react';
import Customer from "./components/Customer";

const customers = [{
  'id' : 1,
  'image' : 'http://placeimg.com/64/64/any',
  'name' : '마호돌',
  'birthday' : '890112',
  'gender' : '남자',
  'job' : '교사'
},
  {
    'id' : 2,
    'image' : 'http://placeimg.com/64/64/1',
    'name' : '박주희',
    'birthday' : '920112',
    'gender' : '여자',
    'job' : '교사'
  },
  {
    'id' : 3,
    'image' : 'http://placeimg.com/64/64/2',
    'name' : '신희송',
    'birthday' : '930112',
    'gender' : '여자',
    'job' : '교사'
  }]

class App extends Component{
  render() {
    return (
        <div>
          {
            customers.map(c => {
              return (
                  <Customer
                      key={c.id}
                      id={c.id}
                      image={c.image}
                      name={c.name}
                      birthday={c.birthday}
                      gender={c.gender}
                      job={c.job}
                  />
              );
            })
          }
        </div>
    );
  }
}

export default App;
